description:
A beautiful secluded Island. Five good friends. And a killer out for revenge.

Five students on spring break meet at a secluded island cabin for a weekend getaway. After a night of music, drinking and getting re-acquainted the five friends are shocked to find the cabin's caretaker murdered and the only boat off the island gone.

Stranded on the island they become the prey of a mysterious killer who seems bent on revenge for something the friends have done. They must defend themselves and find their tormentor or face death one by one...

